    <style>
      .line_up-wrap {
        width: 70%;
        margin-left: 15%;
        margin-top: 30vh;
      }
      .line_up-wrap .line_up-img{
        width: 80%;
        margin-left: 10%;
      }
      .line_up-wrap .tips-title {
        font-size: 14px;
        font-weight: 400;
        color: #666;
        text-align: center;
        margin: 15px 0 22px;
      }
      .line_up-wrap .btn-wrap {
        width: 100%;
        text-align: center;
      }
      .line_up-wrap .back-btn:link,
      .line_up-wrap .back-btn:visited,
      .line_up-wrap .back-btn:hover,
      .line_up-wrap .back-btn:active {
        color: #fff;
        text-decoration: none;
        font-size: 14px;
        display: inline-block;
        background-image: linear-gradient(128deg, #FFAD8D 0%, #FF5D4A 100%);
        border-radius: 35px;
        padding: 5px 15px;
        font-weight: 400;
      }
      .line_up-wrap .sub-title {
        font-size: 14px;
        color: #666;
        font-weight: 400;
        text-align: center;
      }
      .line_up-wrap .times {
        color: #FF6A45;
      }
    </style>
